import React, { useState, useEffect } from 'react';
import { Box, Container, Typography, Grid, Paper, Table, TableBody, TableCell, 
  TableContainer, TableHead, TableRow, Button } from '@mui/material';
import { Link } from 'react-router-dom';
import api from '../../services/api';

function Dashboard() {
  const [bookings, setBookings] = useState([]);

  useEffect(() => {
    fetchBookings();
  }, []);

  const fetchBookings = async () => {
    try {
      const response = await api.getBookings();
      setBookings(response.data);
    } catch (error) {
      alert('Gagal mengambil data pemesanan');
    }
  };

  const handleStatusUpdate = async (bookingId, newStatus) => {
    try {
      await api.updateBooking(bookingId, { status: newStatus });
      fetchBookings();
    } catch (error) {
      alert('Gagal mengupdate status');
    }
  };

  return (
    <Box sx={{ display: 'flex' }}>
      {/* Sidebar */}
      <Box sx={{ 
        width: 240, 
        bgcolor: '#1976d2',
        minHeight: '100vh',
        p: 3,
        color: 'white'
      }}>
        <Typography variant="h6" sx={{ mb: 4, fontWeight: 'bold' }}>
          Admin Dashboard
        </Typography>
        <Button
          component={Link}
          to="/admin/dashboard"
          fullWidth
          sx={{ color: 'white', mb: 2 }}
        >
          Dashboard
        </Button>
        <Button
          component={Link}
          to="/admin/rooms"
          fullWidth
          sx={{ color: 'white', mb: 2 }}
        >
          Rooms
        </Button>
        <Button
          component={Link}
          to="/"
          fullWidth
          sx={{ color: 'white', mt: 'auto' }}
        >
          Logout
        </Button>
      </Box>

      {/* Main content */}
      <Box sx={{ flexGrow: 1, p: 3 }}>
        <Container maxWidth="lg">
          <Typography variant="h4" sx={{ mb: 4 }}>Dashboard Admin</Typography>
          
          <TableContainer component={Paper}>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>Nama Tamu</TableCell>
                  <TableCell>Tipe Kamar</TableCell>
                  <TableCell>Check-In</TableCell>
                  <TableCell>Check-Out</TableCell>
                  <TableCell>Status</TableCell>
                  <TableCell>Aksi</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {bookings.map((booking) => (
                  <TableRow key={booking.id}>
                    <TableCell>{booking.guestName}</TableCell>
                    <TableCell>{booking.room?.room_type}</TableCell>
                    <TableCell>{booking.checkIn}</TableCell>
                    <TableCell>{booking.checkOut}</TableCell>
                    <TableCell>{booking.status}</TableCell>
                    <TableCell>
                      <Button
                        variant="contained"
                        size="small"
                        onClick={() => handleStatusUpdate(booking.id, 'CHECK_IN')}
                      >
                        Update Status
                      </Button>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </Container>
      </Box>
    </Box>
  );
}

export default Dashboard;
